import React, { useState, useRef } from 'react';
import './App.css';

function App() {
  const [selectedFile, setSelectedFile] = useState(null);
  const [preview, setPreview] = useState(null);
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [dragOver, setDragOver] = useState(false);
  const fileInputRef = useRef(null);

  const handleFileChange = (event) => {
    const file = event.target.files[0];
    handleFile(file);
  };

  const handleFile = (file) => {
    if (file && file.type.startsWith('image/')) {
      setSelectedFile(file);
      const reader = new FileReader();
      reader.onload = (e) => setPreview(e.target.result);
      reader.readAsDataURL(file);
      setResult(null);
    }
  };

  const handleDragOver = (e) => {
    e.preventDefault();
    setDragOver(true);
  };

  const handleDragLeave = (e) => {
    e.preventDefault();
    setDragOver(false);
  };

  const handleDrop = (e) => {
    e.preventDefault();
    setDragOver(false);
    const file = e.dataTransfer.files[0];
    handleFile(file);
  };

  const handleClick = () => {
    fileInputRef.current.click();
  };

  const handleSubmit = async () => {
    if (!selectedFile) return;

    setLoading(true);
    const formData = new FormData();
    formData.append('file', selectedFile);

    try {
      const response = await fetch('http://localhost:8000/predict-image', {
        method: 'POST',
        body: formData,
      });
      const data = await response.json();
      setResult(data);
    } catch (error) {
      setResult({ error: 'Failed to get prediction. Make sure the backend is running.' });
    } finally {
      setLoading(false);
    }
  };

  const getConfidencePercentage = () => {
    if (!result || result.error) return 0;
    return Math.round((1 - result.final_score) * 100);
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Deepfake Detection</h1>
        <p>Upload an image to verify its authenticity</p>
      </header>

      <div className="upload-section">
        <div
          className={`upload-area ${dragOver ? 'dragover' : ''}`}
          onDragOver={handleDragOver}
          onDragLeave={handleDragLeave}
          onDrop={handleDrop}
          onClick={handleClick}
        >
          <div className="upload-icon">üìÅ</div>
          <div className="upload-text">
            {selectedFile ? `Selected: ${selectedFile.name}` : 'Click to upload or drag and drop an image'}
          </div>
          <input
            ref={fileInputRef}
            type="file"
            accept="image/*"
            onChange={handleFileChange}
            className="file-input"
          />
        </div>

        {preview && (
          <img src={preview} alt="Preview" className="preview" />
        )}
      </div>

      <button onClick={handleSubmit} disabled={!selectedFile || loading}>
        {loading ? (
          <>
            Analyzing...
            <div className="loading"></div>
          </>
        ) : (
          'Check Authenticity'
        )}
      </button>

      {result && (
        <div className={`result ${result.prediction === 'REAL' ? 'real' : 'fake'}`}>
          {result.error ? (
            <div>
              <h2>Error</h2>
              <p>{result.error}</p>
            </div>
          ) : (
            <div>
              <h2>Result: {result.prediction}</h2>
              <p>Confidence: {getConfidencePercentage()}%</p>
              <div className="confidence-bar">
                <div
                  className={`confidence-fill ${result.prediction === 'FAKE' ? 'fake' : ''}`}
                  style={{ width: `${getConfidencePercentage()}%` }}
                ></div>
              </div>
              <p style={{ fontSize: '0.9rem', marginTop: '10px', color: '#666' }}>
                This is a prototype model. Results may not be accurate.
              </p>
            </div>
          )}
        </div>
      )}
    </div>
  );
}

export default App;
